import React, {Component} from 'react';
import moment from 'moment';

export default class SeriesDialog extends Component {
    render() {
        console.log('seriesdialog props: ', this.props)
        // let releaseDate = new Date(this.props.episode.Released);
        // let formattedReleaseDate = moment(this.props.episode.Released).format('DD/MM/YYYY')
        return (
            <div className='episodeContainer'>
                <input type='checkbox'/>
                <p>{this.props.episode.Title}</p>
                <p>{moment(this.props.episode.Released).format('DD/MM/YYYY')}</p>
            </div>
        )
    }
}
